아니 저 베댓들 작성 날짜를 보라고;
추리한 '척'이 아니라 추리한거 맞아
가만히 있으면 반이라도 간다는데 왜이러는거야?

물타기 적당히해 진짜 슈퍼스트링 작품이라고 진짜 머가리 없냐? 애초에 내용 다이어지는데 작가님도 생각이 다 있겠지
니들 맘대로 스토리 맘에 안들다고 질질끈다고 빼애애액 거리지마 나중에 또 반전 나오고 다른 웹툰이랑 내용 이어지면
소름이라고 막 이런반전이 있었구나 하면서 또 빨아주지말고 베댓들아 제발 좀 물타기좀 하지마 꼴뵈기 싫어 베댓되려고 어떻게든 발광을 한다 아주그냥;
